class HashSet {
    constructor() {
        this.baskets = Array.from({length: 5}, () => [])
        this.size = 0
    }

    get basketSize() {
        return this.baskets.length
    }

    #increaseBasket() {
        const baskets = this.baskets

        this.baskets = Array.from({length: this.basketSize * 2}, () => [])
        baskets.forEach((basket) => {
            basket.forEach((element) => {
                this.add(element)
            })
        })
    }

    add(element) {
