    get(element) {
        const hashCode = this.hashCode(element)
        const basket = this.baskets[hashCode]

        return basket.find((item) => Object.is(element, item)) ?? null
    }

    has(element) {
        const hashCode = this.hashCode(element)
        const basket = this.baskets[hashCode]

        return basket.includes(element)
    }

   delete(element) {
        const hashCode = this.hashCode(element)
        const size = this.baskets[hashCode].length

        this.baskets[hashCode] = this.baskets[hashCode].filter((item) => !Object.is(item, element))
        this.size--

        return size !== this.baskets[hashCode].length
    }

    hashCode(element) {
        let s = String(element)
        let result = 0

        for (let char of s) {
            result += char.charCodeAt()
        }

        return result % this.basketSize
    }
}
